import React, { useEffect, useState } from "react";
import { Link } from "react-router-dom";

export default function ComparePage() {
  const [products, setProducts] = useState([]);
  const [sortBy, setSortBy] = useState("");

  useEffect(() => {
    fetch("http://localhost:5000/api/admin")
      .then((res) => res.json())
      .then((data) => setProducts(Array.isArray(data) ? data : []))
      .catch((err) => console.error("❌ Error loading products:", err));
  }, []);

  const getBestRating = () => Math.max(...products.map(p => p.AverageRating || 0));
  const getBestPrice = () => Math.min(...products.map(p => parseFloat(p.Price) || Infinity));

  const sorted = [...products].sort((a, b) => {
    if (sortBy === "rating") return (b.AverageRating || 0) - (a.AverageRating || 0);
    if (sortBy === "price") return parseFloat(a.Price) - parseFloat(b.Price);
    return 0;
  });

  return (
    <div className="bg-gray-100 min-h-screen py-12 px-4">
      <div className="max-w-7xl mx-auto">
        <Link to="/" className="inline-block mb-6 text-blue-600 hover:underline font-medium">
          ← Back to Home
        </Link>

        <h2 className="text-4xl font-extrabold text-center text-gray-800 mb-2">
          Antivirus Comparison
        </h2>
        <p className="text-center text-gray-600 mb-6">
          Compare features, pricing, and performance to find the right antivirus solution for your needs.
        </p>

        <div className="flex justify-center gap-4 mb-6">
          <button
            className="px-4 py-2 bg-blue-600 text-white rounded hover:bg-blue-700"
            onClick={() => setSortBy("rating")}
          >
            Sort by Rating
          </button>
          <button
            className="px-4 py-2 bg-blue-600 text-white rounded hover:bg-blue-700"
            onClick={() => setSortBy("price")}
          >
            Sort by Price
          </button>
        </div>

        <div className="overflow-x-auto bg-white rounded-2xl shadow-xl">
          <table className="w-full text-sm text-left border-collapse">
            <thead className="bg-blue-50 text-blue-800 uppercase text-xs font-semibold">
              <tr>
                <th className="px-6 py-4">Antivirus</th>
                <th className="px-6 py-4">Rating</th>
                <th className="px-6 py-4">Price/Year</th>
                <th className="px-6 py-4">Platforms</th>
              </tr>
            </thead>
            <tbody className="divide-y divide-gray-200">
              {sorted.map((product) => (
                <tr key={product.ProductID} className="hover:bg-gray-50 transition">
                  <td className="px-6 py-4 font-medium text-gray-900">
                    {product.ProductName || "Unknown"}
                  </td>
                  <td className={`px-6 py-4 font-medium ${product.AverageRating === getBestRating() ? "text-green-600 font-bold" : "text-yellow-600"}`}>
                    {product.AverageRating ? `${product.AverageRating.toFixed(1)} / 5.0` : "–"}
                  </td>
                  <td className={`px-6 py-4 font-medium ${parseFloat(product.Price) === getBestPrice() ? "text-green-600 font-bold" : "text-blue-700"}`}>
                    {product.Price}
                  </td>
                  <td className="px-6 py-4">
                    <div className="flex flex-wrap gap-2">
                      {(product.Platforms || "").split(",").map((os) => (
                        <span
                          key={os}
                          className="bg-gray-200 text-gray-800 px-3 py-1 rounded-full text-xs"
                        >
                          {os.trim()}
                        </span>
                      ))}
                    </div>
                  </td>
                </tr>
              ))}
            </tbody>
          </table>
        </div>
      </div>
    </div>
  );
}
